import React from 'react';
import styles from '../styles/header.module.css';
import MyButton from './MyButton';

import Logo from '../assets/svg/header/Logo.svg';
import Cards from '../assets/svg/header/Cards.svg';
import Business from '../assets/svg/header//Business.svg';
import Services from '../assets/svg/header/Services.svg';
import About from '../assets/svg/header/About Us.svg';
import login from '../assets/svg/header/Frame 11.svg';
import logout from '../assets/svg/header/Frame 10.svg';

const Header: React.FC = () => {
  return (
    <header className={styles.header}>
      <LogoSection />
      <ButtonSection />
    </header>
  );
};

const LogoSection: React.FC = () => {
  return (
    <div className={styles.logocontainer}>
      <img src={Logo} className={styles.logo} />
      <div className={styles.buttonscontainer}>
        <MyButton image={Cards} userhref='#' />
        <MyButton image={Services} userhref='#'/>
        <MyButton image={Business} userhref='#'/>
        <MyButton image={About} userhref='#'/>
      </div>
    </div>
  );
};

const ButtonSection: React.FC = () => {
  return (
    <div className={styles.buttonscontainerend}>
      <MyButton image={login} userhref='#'/>
      <MyButton image={logout} userhref='#'/>
    </div>
  );
};

export default Header;
